  b 10.07.1938
  b 04.04.1938
  Anne b. at Waipawa and m, at Christ Church, Pukehou, Royston, s/o Pitihira Seymour and Titihuia Raana
  Te Hiko. Address: 6 Rose Street, Waipawa.
  Anne was educated at Otane School and Iona College, Havelock North. She studied art at Canterbury
  University and taught art at Central Hawkes Bay College from 1972 to 1975, then trained as an enrolled
  nurse. She is still working as a nurse and Royston is a farm advisory trustee. Both Anne and Roy have
  a deep interest in live theatre and that interest has been passed on to their daughters.
